import axios from "axios";
import { ref } from "vue";

export default function backend(url) {
  const apiCall = async () => {
    return await axios.get(url).then((response) => {
      apiData.value = response.data;
    });
  }
  const apiData = ref(apiCall());

  return {
    apiData
  }
}
